import React from 'react';
import "./Gallery.css"
import { Swiper, SwiperSlide } from 'swiper/react';
import SwiperCore, {EffectCoverflow, Navigation, Pagination, Scrollbar,} from 'swiper';
import 'swiper/swiper.scss';
import 'swiper/components/navigation/navigation.scss';
import 'swiper/components/pagination/pagination.scss';
import 'swiper/components/scrollbar/scrollbar.scss';
import "swiper/components/effect-coverflow/effect-coverflow.scss"


SwiperCore.use([EffectCoverflow, Navigation, Pagination, Scrollbar,]);


export default function Gallery() {

  return (
      <>

    <div id="Gallery">

      <div className= "backgroundImage" >

                        <div className="heading-gallery">
                           <h2  >
                            Take a look at some of our work.
                            </h2>

                            </div>

                    <div className="slideshow">  

                    <Swiper
                        className="swiper-slideshow"
                        navigation
                        grabCursor= "true"
                        centeredSlides= "true"
                        slidesPerView= '3'
                        effect="coverflow"

                        coverflowEffect= {{
                        rotate: 50,
                        stretch: 0,
                        depth: 100,
                        modifier: 1,

                      }}

                        >
                        <SwiperSlide><img className="image" src="./images/slideshowpic1.jpeg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/slideshowpic2.jpeg" alt=""/></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/slideshowpic3.jpeg" alt=""/><h4>Spotlights and smoke alarm installed</h4></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/slideshowpic4.jpeg" alt=""/><h4>Bonding behind kitchen sink</h4></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/slideshowpic5.jpeg" alt=""/><h4>New fuseboard installed and tested</h4></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/slideshowpic6.jpeg" alt=""/><h4>Bonding</h4></SwiperSlide>

                        </Swiper>

        </div>  

     </div>  

     </div>

</>


  )}
